import styled from "styled-components";

export const Nav = styled.nav`
  flex-basis: 200px;
  border-right-style: solid;
  border-right-width: thin;
`

export const MenuVertical = styled.li`
  flex-basis: 200px;
  border-right-style: solid;
  border-right-width: thin;
`
